import './Second.css';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';

function Second() {
    const navigate = useNavigate();
    const [orderNum, setOrderNum] = useState();

    const takeOut = () => {
        fetch('http://127.0.0.1:5000/api/start/takeOut')
        .then(response => response.json())
        .then(data => {
            setOrderNum(data.order_num);
            if(orderNum === undefined) {
                takeOut();
            }
            else {
                navigate('/menu?id=' + orderNum);
            }
        });
    };
    const eatIn = () => {
        fetch('http://127.0.0.1:5000/api/start/eatIn')
        .then(response => response.json())
        .then(data => {
            setOrderNum(data.order_num);
            navigate('/menu?id=' + orderNum);
        });
    };
    return (
        <div className='total'>
            <button className='takeOut' onClick={takeOut}>포장</button><br/>
            <button className='eatIn' onClick={eatIn}>매장</button>
        </div>
    );
}

export default Second;
